import { HashRouter as Router, Route, Link } from 'react-router-dom';



export default class App extends Component {
      constructor(props){
        super(props);
        this.state={email:'',password:'',find:''};
        this.handleChange=this.handleChange.bind(this);
        this.handleSubmit=this.handleSubmit.bind(this);
        }
 render() {
    return (
<div class="container">
<div class="col-sm-6 col-sm-offset-3">

    <h1><span class="fa fa-sign-in"></span> Signup</h1>


    <form action="/signup" method="post" onSubmit={this.handleSubmit}>
        <div class="form-group">
            <label>Email</label>
            <input type="text" class="form-control" name="email" onChange={this.handleChnage}/>
        </div>
        <div class="form-group">
            <label>Password</label>
            <input type="password" class="form-control" name="password" onChange={this.handleChnage}/>
        </div>

        <button type="submit" class="btn btn-warning btn-lg">Signup</button>
    </form>

    <hr></hr>


    <p>or go <a href="/" >home</a>.</p>



</div>
</div>

    );
  }
}
